import React from 'react';
import classes from './cartcontent.module.css';
import Card from '../Card/Card';
function CartContent(props) {
    return (
        <Card>
            <div >
                <h2>{props.name}</h2>
                <p>{props.price}</p>
                <span>{props.amount}</span>
                <button>-</button>
                <button>+</button>
            </div>
        </Card>
    )
}

export default CartContent;
